import { Card } from '@mui/material';
import styled from 'styled-components';

export const Container = styled(Card)`
  bottom: 100px;
  position: fixed;

  font-size: 14px;
  width: 305px;

  display: flex;
  flex-direction: column;
  border-radius: 5px !important;
`;
